"use strict";(self.webpackChunkcs_2_maps_wiki=self.webpackChunkcs_2_maps_wiki||[]).push([[85],{5008:i=>{i.exports=JSON.parse('{"blogPosts":[{"id":"/why-a-wiki","metadata":{"permalink":"/cs2-maps-wiki/blog/why-a-wiki","source":"@site/blog/why-a-wiki.md","title":"Why a wiki","description":"We wanted to create this wiki to share the tips, tricks, and workflows we have developed through Cities Skylines II. Outside of a few points in the official wiki, Cities: Skylines I map making information was difficult to find, and applying general QGIS methods to our specific needs required lots of trial and error.","date":"2023-12-13T05:18:00.000Z","formattedDate":"December 13, 2023","tags":[],"readingTime":0.555,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"unlisted":false},"content":"We wanted to create this wiki to share the tips, tricks, and workflows we have developed through Cities: Skylines I and now into Cities: Skylines II. Outside of a few points in the official wiki, Cities: Skylines I map making information was difficult to find, and applying general QGIS methods to our specific needs required lots of trial and error. \\r\\n\\r\\nWe hope that this wiki will be a consolidated resource for information about map making that compliments official information made available by Colossal Order and how to apply QGIS/GIS methods towards the specific goal of creating maps for Cities: Skylines II. \\r\\n\\r\\nThanks for visting, we hope you\'ve found this site helpful!"}]}')}}]);